import { getAllUsers } from "./DATA";
import { useDispatch } from "react-redux";
import { loadUsers } from "./actions"; // it take user return type +users

function App() {
  // if user is login

  const dispatch = useDispatch();
  //getAllUsers().then(users =>console.log(users))
  getAllUsers().then((users) => dispatch(loadUsers(users)));
  //return <div className="App">Choose one App</div>;

  return (
    <div className="App">
    <form action="http://httpbin.org/post" method="post">
    <select data-placeholder="Begin typing a name to filter..." multiple className="chosen-select" name="test">
      <option value />
      <option>American Black Bear</option>
      <option>Asiatic Black Bear</option>
      <option>Brown Bear</option>
      <option>Giant Panda</option>
      <option>Sloth Bear</option>
      <option>Sun Bear</option>
      <option>Polar Bear</option>
      <option>Spectacled Bear</option>
    </select>
    <input type="submit" />
  </form>
  </div>
  );
}

export default App;
